-- TEST MODE :
-- DROP DATABASE IF EXISTS banque;

CREATE DATABASE IF NOT EXISTS banque CHARACTER SET 'utf8';

USE banque;

-- Création des tables
CREATE TABLE IF NOT EXISTS client (
    idclient MEDIUMINT UNSIGNED NOT NULL,
    nom VARCHAR(30) NOT NULL,
    prenom VARCHAR(30) NOT NULL,
    adresse VARCHAR(50) NOT NULL,
    ville VARCHAR(30) NOT NULL,
    code_postal SMALLINT UNSIGNED NOT NULL,
    reg_nat CHAR(14) NOT NULL COMMENT '1234567-123-12'
)  ENGINE=INNODB , CHARACTER SET UTF8;

CREATE TABLE IF NOT EXISTS compte (
    iban CHAR(19) NOT NULL,
    solde_min DECIMAL(12 , 2 ) NOT NULL DEFAULT 0.0,
    solde DECIMAL(12 , 2 ) NOT NULL DEFAULT 0.0
)  ENGINE=INNODB , CHARACTER SET UTF8;

CREATE TABLE client_compte (
    idclient MEDIUMINT UNSIGNED NOT NULL,
    iban CHAR(19) NOT NULL
)  ENGINE=INNODB , CHARACTER SET UTF8;

CREATE TABLE IF NOT EXISTS transfert (
    idtransfert MEDIUMINT UNSIGNED NOT NULL,
    montant DECIMAL(12 , 2 ) NOT NULL,
    iban_debit CHAR(19) NOT NULL,
    iban_credit CHAR(19) NOT NULL,
    moment DATETIME NOT NULL,
    statut ENUM('TODO', 'OPEN', 'DONE') NOT NULL
)  ENGINE=INNODB , CHARACTER SET UTF8;

-- Ajout des PK et AI
ALTER TABLE client ADD PRIMARY KEY (idclient);
ALTER TABLE compte ADD PRIMARY KEY (iban);
ALTER TABLE client_compte ADD PRIMARY KEY (idclient, iban);
ALTER TABLE transfert ADD PRIMARY KEY (idtransfert);

ALTER TABLE client MODIFY COLUMN idclient MEDIUMINT UNSIGNED NOT NULL AUTO_INCREMENT;
ALTER TABLE transfert MODIFY COLUMN idtransfert MEDIUMINT UNSIGNED NOT NULL AUTO_INCREMENT;

ALTER TABLE client ADD UNIQUE INDEX (reg_nat);

-- Ajout des FK
ALTER TABLE client_compte ADD CONSTRAINT fk_client_compte_compte FOREIGN KEY (iban) REFERENCES compte(iban) ON DELETE RESTRICT ON UPDATE CASCADE;
ALTER TABLE client_compte ADD CONSTRAINT fk_client_compte_client FOREIGN KEY (idclient) REFERENCES client(idclient) ON DELETE RESTRICT ON UPDATE CASCADE;
ALTER TABLE transfert ADD CONSTRAINT fk_compte_debit_transfert FOREIGN KEY (iban_debit) REFERENCES compte(iban) ON DELETE RESTRICT ON UPDATE CASCADE;
ALTER TABLE transfert ADD CONSTRAINT fk_compte_credit_transfert FOREIGN KEY (iban_credit) REFERENCES compte(iban) ON DELETE RESTRICT ON UPDATE CASCADE;

